import Layout from '../../components/Layout';

export default function About() {

    let posts = [
        { id: 1, content: 'My day at the park' },
        { id: 2, content: 'Trip to the beach' }
    ]

    function PostsList(props) {
        const listItems = posts.map((post) =>
            <li>
                <Link href={'./posts/' + post.id}>
                    <a>{ post.content }</a>
                </Link>
            </li>
        );

        return (
            <ul>{ listItems }</ul>
        )
    }

    return (
        <Layout>
            <h1>Posts</h1>

            <PostsList></PostsList>

        </Layout>
    );
}
